pub enum Network {

    /// Represent an IPv4 network address
    V4(Ipv4Addr, Ipv4Addr),

    /// Represent an IPv6 network address
    V6(Ipv6Addr, Ipv6Addr),
}

pub enum ScopedIp {

    /// Represent an IPv4 address
    V4(Ipv4Addr),

    /// Represent an IPv6 and its scope identifier, if any
    V6(Ipv6Addr, Option<String>),
}

pub enum Lookup {

    /// Search for entries in /etc/hosts
    File,

    /// Query a domain name server
    Bind,

    /// A database we don't know yet
    Extra(String),
}

pub enum Family {

    /// A A lookup for an ipv4 address
    Inet4,

    /// A AAAA lookup for an ipv6 address
    Inet6,
}
